configure:
  commands:
    end:
      new_state: execute
    interface vlan10: "interface vlan10\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    standby 0  ip 10.1.0.3: "standby 0  ip 10.1.0.3\r\n"
    standby 0  preempt delay sync 0: "standby 0  preempt delay sync 0\r\n"
    standby 0 timers 1 4: "standby 0 timers 1 4\r\n"
  prompt: 9300-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: 9300-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: 9300-1#
